(47, 1, 'A Trusted Real Estate Advisor Provides Expert Advice', '<p><strong>Lorem Ipsum</strong>&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged.</p>\r\n\r\n<p>It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>\r\n\r\n<p>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using &#39;Content here, content here&#39;, making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for &#39;lorem ipsum&#39; will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</p>', 'a-trusted-real-estate-advisor-provides-expert-advice', '/public/upload/blogs/1687091875rumeysa-aydin-ti68sgG3qZw-unsplash.jpg', '16', 1, '2022-09-04 09:20:37', '2023-07-27 09:53:38', NULL, NULL, 'public/site_assets/img/kazi-manzur.jpg', 1),
(48, 1, 'প্রফেশনাল হতাশা থেকে বের হতে যেভাবে চিন্তা করা দরকার!', '<p>আমরা প্রফেশনাল্লি একেকজন একেক যায়গা থেকে নিজেকে এগিয়ে নিয়ে যাচ্ছি, বিষয়টিকে কিন্তু এমনভাবেও ভাবা যায় যে</p>\r\n\r\n<blockquote>আমরা দক্ষতা অনুযায়ী একেকজন একেক অবস্থান থেকে সমাজ, রাষ্ট্র এবং আমাদের পরিবারকে এগিয়ে নিয়ে যাচ্ছি।</blockquote>\r\n\r\n<p>ভাবনাটা যদি আত্নকেন্দ্রিক না হয়ে সামষ্টিক হয় তাতে বেশ কিছু পজেটিভ দিক রয়েছে, আজকের আলোচনার বিষয় মূলত এটি ই।</p>\r\n\r\n<p>যখন আপনার ভাবনাটি সামষ্টিক হবে তখন আপনি আসলে সঠিক ব্যাক্তি দিয়ে সঠিক কাজটি করিয়ে নিতে পারবেন। এতে করে নিদৃষ্ট কাজের ক্ষেত্রে আপনার নিজের উপর চাপ যেমন কমবে তেমনি যাকে দিয়ে কাজটি করাবেন তিনিও প্রফেশনাল্লি উপকৃত হবেন।</p>\r\n\r\n<p>সবচেয়ে বড় কথা হল যখন আপনি সামষ্টিক ভাবনা থেকে নিদৃষ্ট কাজটি একজন ব্যাক্তিকে দিবেন তখন সেখানে সত্যিকার আন্তরিকতাপূর্ন একটি সম্পর্ক তৈরি হবে যার রেজাল্ট হিসাবে আপনি অতিরিক্ত সার্ভিস ওই ব্যাক্তি থেকে পাবেন। আমরা মূলত নিদৃষ্ট বিষয়ে আমাদের দক্ষতার মাধ্যমে একে অপরকে সাহায্য করে আমাদের ব্যাবসা, চাকুরি থেকে শুরু করে পুরো সোস্যাল সিস্টেমকে টিকিয়ে রাখি। এই প্রফেশনাল সাহায্যের বিনিময়ে আমরা যেটা রিটার্ন হিসাবে পাই তা দিয়ে আমরা নিজেদের প্রয়োজনগুলি মিটাই।</p>\r\n\r\n<p>এই নিজেদের প্রোয়োজন মিটাতে গিয়ে আমরা কিন্তু আবার অন্যের সাহায্য নেই যার বিনিময়ে আমরা আবার তাকে রিটার্ন হিসাবে এই স্যালারি বা প্রফিটটা দেই। আর এভাবেই চক্রাকারভাবে আমাদের পুরো সিস্টেমটি চলছে বা টিকে থাকছে।</p>\r\n\r\n<p>সামষ্টিকভাবে যদি আমরা বিষয়টি নিয়ে ভাবি তবে পজেটিভ যেটি ঘটবে তা হল আমরা পরস্পরে পরস্পরের প্রতি সর্বদা একটা সম্মানসূচক ভাব বজায় রাখতে পারব যেটি মূলত আমাদের সমাজে প্রচন্ডরকম অভাব। যার কারনে প্রায় অধিকাংশই প্রফেশনাল জীবন, সামাজিক জীবন নিয়ে হাতাশার মধ্যে কাটাচ্ছে।</p>\r\n\r\n<p>একটি দিনের অধিকাংশ এক্টিভ সময় ই আমরা কাটাই আমাদের অফিসে, আর সার্ভিস দিতে গিয়ে যদি আমরা স্বাচ্ছন্দবোধ না করি কিংবা বিভিন্ন প্রফেশনাল হতাশা কাজ করে তবে আমরা আমাদের সেরাটা দিতে যেমন ব্যার্থ হই তেমনি পরবর্তী হতাশার জন্য পূর্বের এই সেরাটা দিতে না পারা আরেকটি কারন হয় আর এভাবেই আমরা একটি হতাশাপূর্ন সিস্টেমে প্রবেশ করি।</p>\r\n\r\n<p>হতাশাপূর্ন সিস্টেম থেকে বের হওয়ার জন্য অধিনস্ত কিংবা অন্য যার মাধ্যমে সার্ভিস নিচ্ছি তার সাথে সঠিক আচরনটাই করি এবং সঠিক পারিশ্রমিক দেয়ার অভ্যাস তৈরিতে প্রথম পদক্ষেপটি আমরাই নেই।</p>\r\n\r\n<p><strong>মানুষ সমাজবদ্ধ হয়ে বাস করার পেছনের যে কারনটি ছিল তা যদি এই মডার্ণ জীবনে আমরা মনে রাখতে পারি তবে আমাদের প্রত্যেকের জীবনই হতে পারে অনেক সমৃদ্ধ স্বাচ্ছন্দময় এবং গর্বের।</strong></p>', '', '/public/upload/blogs/1687091865Pasta creative.jpg', '17', 1, '2022-10-29 10:24:11', '2023-06-18 12:37:45', NULL, NULL, 'public/site_assets/img/kazi-manzur.jpg', 1),
(49, 1, 'Noodles', '<p><strong>Lorem Ipsum</strong>&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged.</p>\r\n\r\n<p>It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>\r\n\r\n<p>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using &#39;Content here, content here&#39;, making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for &#39;lorem ipsum&#39; will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</p>', 'noodles', '/public/upload/blogs/1687091855Noodles creative.jpg', '17', 1, '2023-06-04 05:25:07', '2023-07-27 09:53:27', NULL, NULL, 'public/site_assets/img/kazi-manzur.jpg', 1),
(50, 1, 'Dry Cake Emerges as the Ideal Snack for Students and Young Executives', '<p>&nbsp;</p>\r\n\r\n<h1><strong>In a world where time is of the essence</strong></h1>\r\n\r\n<p>&nbsp;students and young executives are constantly seeking quick and convenient snack options to fuel their busy lives. Enter dry cake, a rising star among snack choices for this demographic. With its portability, long shelf life, and delightful flavors, dry cake has garnered attention as the go-to snack for individuals on the go. Packed with energy-boosting nutrients and available in a variety of tempting flavors, it has become a favorite among those seeking a tasty and convenient treat to keep them going throughout the day.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dry cake&#39;s popularity stems from its ability to provide an instant energy boost when it&#39;s needed most. Students rushing between classes or young executives juggling demanding workloads can rely on the carbohydrates and essential nutrients found in dry cake to sustain their energy levels. The snack&#39;s compact size and convenient packaging make it easy to carry in backpacks or briefcases, ensuring that students and young professionals always have a satisfying snack at their fingertips, no matter how hectic their schedules may be.</p>\r\n\r\n<p>What sets dry cake apart from other snack options is its long shelf life, making it a reliable choice for busy individuals. Unlike fresh pastries or baked goods that quickly go stale, dry cake can last for extended periods without compromising on taste or texture. This aspect of the snack makes it a practical choice for those who don&#39;t have the time or opportunity to regularly restock their snack supply. With a variety of flavors to choose from, including classic options like chocolate and vanilla, as well as more adventurous combinations, dry cake offers a snack experience that can cater to a range of taste preferences.</p>\r\n\r\n<p>In conclusion, as the demands of student life and professional responsibilities continue to increase, the popularity of dry cake as a snack choice for students and young executives is on the rise. Its portability, long shelf life, and diverse range of flavors make it a convenient and delicious option. Whether it&#39;s providing an energy boost during a study session or serving as a quick bite between meetings, dry cake has established itself as a reliable and enjoyable snack for individuals with busy lifestyles.</p>\r\n\r\n<p>&nbsp;</p>', 'dry-cake-emerges-as-the-ideal-snack-for-students-and-young-executives', '/public/upload/blogs/1687091774Dry cake.jpg', '16', 1, '2023-06-06 09:35:12', '2023-07-27 09:53:49', NULL, NULL, 'public/site_assets/img/kazi-manzur.jpg', 1),
(51, 1, 'ফিল হিউজের মৃত্যু এবং ওয়াটসনের চেকলিস্ট', '<p>নিজের সময়ের অন্যতম সেরা অলরাউন্ডার তিনি। অস্ট্রেলিয়ার সাবেক এই অলরাউন্ডার আন্তর্জাতিক ক্রিকেটে ব্যাট হাতে করেছেন দশ সহস্রাধিক রান, বল হাতে আছে ২৯১ উইকেট। দ্য ক্রিকেট মান্থলিকে দেওয়া সাক্ষাৎকারের প্রথম পর্বে শেন ওয়াটসন কথা বলেছেন তার টেকনিক্যাল আর মানসিক দক্ষতার যোগ নিয়ে, আইপিএলের ফাইনালে তাঁর অসাধারণ সেঞ্চুরি নিয়ে এবং সতীর্থ ফিল হিউজের মর্মান্তিক বিদায় নিয়ে।</p>\r\n\r\n<p><strong><em>২০১৮ আইপিএলের ফাইনাল নিয়ে কথা বলা যাক। আপনাদের সামনের লক্ষ্যমাত্রাটা খুব বড় না হলেও বেশ কঠিন ছিল, আর শুরুর দশ বল মোকাবেলা করেও আপনি রানের খাতা খুলতে পারেননি। ভুবনেশ্বর কুমার আপনার বিরুদ্ধে একটি মেইডেন ওভার করলেন, আপনাকে দু&rsquo;বার পরাস্তও করলেন। এমন পরিস্থিতি থেকে সেঞ্চুরি করা, চেন্নাই সুপার কিংসকে ফাইনাল জেতানো &ndash; পুরো ব্যাপারটাতে কতটা মানসিক শক্তির প্রয়োজন ছিল?</em></strong></p>\r\n\r\n<p>২০১৬ থেকে আমি টি-টোয়েন্টি ক্রিকেটকে ভালোভাবে আয়ত্ত্বে আনতে শুরু করি, আর &lsquo;১৮-এর ঐ ইনিংসটা ছিল আমার যাবতীয় শিক্ষার চূড়ান্ত প্রতিফলন। টেকনিক্যাল দৃষ্টিকোণ থেকে দেখলে মনে হবে ঐ ইনিংসের সবকিছুই আমার নিয়ন্ত্রণে ছিল, কিন্তু মানসিক শক্তির দৃষ্টিকোণ থেকে ঐ ইনিংসটা ছিল ২০১৫তে আমার অর্জিত একটা শিক্ষা।</p>\r\n\r\n<p>২০১৫ ছিল আমার ক্যারিয়ারের এমন একটা সময় যখন আমার চারপাশে খুব দ্রুত একের পর এক ঘটনা ঘটছিল। ২০১৪-এর শেষের দিকে ফিল হিউজের ঐ বিয়োগান্তক ঘটনাটা আমার মধ্যে প্রবল ব্যাটিং-ভীতির জন্ম দিয়েছিল। তবে আমি সৌভাগ্যবান ছিলাম। জ্যাকস ডালেইর নামক মার্কিন যুক্তরাষ্ট্রের একজন ডাক্তার আমাকে মানসিকভাবে সাহায্য করেছিলেন। তিনি আমাকে খুব সহজ ভাষায় বুঝিয়েছিলেন, কীভাবে মানুষের মন কাজ করে, কীভাবে নিজের দৃষ্টিভঙ্গি তৈরি হয়, কীভাবে ঐ দৃষ্টিভঙ্গি থেকে বেরিয়ে আসতে হয়, এবং কীভাবে সঠিক মানসিক পরিবেশ সৃষ্টি করতে হয়। ব্যাপারগুলো বোঝার পরে আমি টেকনিক্যাল স্কিলের পাশাপাশি মানসিক স্কিল নিয়েও কাজ করা শুরু করেছিলাম, প্রত্যেকটা ম্যাচে প্রত্যেকটা বলের মুখোমুখি হওয়ার আগে।</p>\r\n\r\n<p>এরপরে, ২০১৬ আইপিএলের ফাইনাল, যেখানে আমি রয়্যাল চ্যালেঞ্জার্স বেঙ্গালুরুর হয়ে খেলেছিলাম, ছিল আমার জীবনের অন্যতম বাজে ম্যাচ, বিশেষত বোলিংয়ের দৃষ্টিকোণ থেকে। আমার চার ওভারে এসেছিল ৬১ রান। আমার প্রস্তুতি ভালো ছিল, কিন্তু কিছু কিছু কারণে আমি আমার সামর্থ্যের পুরোটা দিতে পারিনি, খুব বাজেভাবে এর ফল মেটাতে হয় আমাকে।</p>\r\n\r\n<p>তাই ২০১৮ এর ফাইনালের আগে আমার আলাদা একটা প্রেরণা ছিল। আমি টেকনিক্যাল ও মানসিক &ndash; দুই দিক দিয়েই অনেক বেশি শৃঙ্খলাবদ্ধ ছিলাম। এই ফাইনালটা ছিল আমার কাছে আগের দুই বছরের কাজের চূড়ান্ত পরীক্ষাস্বরূপ, তাই আমি চেষ্টা করছিলাম টেকনিক্যাল ও মানসিক দিক দিয়ে সেরা অবস্থায় থাকার। ঐ ইনিংসের প্রত্যেকটা বলে, এমনকি প্রথম ওভারে আমি যখন ভুবির (ভুবনেশ্বর কুমার) মুখোমুখি হয়েছিলাম, তখনও, আমি আমার টেকনিক্যাল ও মানসিক চেকলিস্টে টিক দিতে দিতে এগোচ্ছিলাম।</p>', '', '/public/upload/blogs/1686052433WhatsApp Image 2023-06-06 at 17.51.48.webp', '14', 1, '2023-06-06 09:35:27', '2023-07-27 09:54:00', NULL, NULL, 'public/site_assets/img/kazi-manzur.jpg', 1);

