 or any monies have been charged back or rescinded.</div><p><strong>COMPLETION TIMEFRAMES:</strong></p><div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\">Client understands, agrees and acknowledges that SiKi Realtor (Dept. of IT) does not guarantee a time frame for completion of ANY website or software project. This is in part because it is difficult to complete a project without design and functionality approvals and participation from the Client. In addition, if the Client continues to submit additional content throughout the development process, or requests additional modifications to the project, the completion time frame is increased. Other factors that may influence the completion date of a project include, but are not limited to, complexity of Client’s project(s), availability of SiKi Realtor (Dept. of IT) personnel, accounting status of Client’s account, etc.</div><div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\">If Client does not respond to SiKi Realtor (Dept. of IT) communications and, as a result, SiKi Realtor (Dept. of IT) is not able to start or complete the website/software project, Client is still responsible for all fees incurred including, but not limited to, design purchase price, set-up fees, enhancements purchased and monthly hosting charges that begin accruing from date of sale. If Client’s website/software requires custom programming, functionality, flash, e-commerce or the use of a database, the overall development time will be extended.</div><p><strong>PAYMENTS &amp; CHARGEBACKS:</strong></p><div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\">Bank check, Personal check, Hand Cash, are all acceptable methods of payment. Prior authorization from SiKi Realtor (Dept. of IT) is required before Client use of a payment by Credit Card.</div><p><strong><em>Project will be start for paying after 30% of contracted project.</em></strong></p><div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\">If payment has not been received by 5 working days, a follow up email will be sent. After 28 days of non-payment, the contract may be terminated. After termination, if the Client wishes to resume, the Client may reinstate the project by remitting the balance of the invoice and service reinstatement fee of up to 20% of total project cost.</div><div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\">Second phase is, after completing 40% of full project clients must have to pay next 40% of contracted project. And the finally after delivered the projects client will pay last 30% of these full agreements and we will hand over source code.</div><p><strong>CANCELLATION FEE AND REFUND POLICY: </strong></p><div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\">Refunds of the fees paid for development of the website / software may be issued on accounts cancelled within 10 days of the initial sale and prior to the completion of the project according to the following schedule:</div><div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\">A) A minimum of a 20% cancellation fee of contracted project will be retained by Contractor on cancelled account even if no work has been started and no content yet submitted by the Client.</div><div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\">B) A minimum of a 25% cancellation fee will be retained of contracted project by Contractor on cancelled accounts if work has been presented to the Client; or Contractor has made multiple attempts to work with the Client, and Client has not responded to those attempts.</div><div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\">C) A 40% cancellation fee will be retained by Contractor and NO REFUND issued if any changes and/or modifications requested by the Client have been completed by Contractor. No Refund will be issued on any website / software cancelled after services have been rendered, including but not limited to, the design work and programming having been completed and/or the software has been moved to client’s server or transferred to their procession.</div><div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\">D) 100% cancellation fee of contracted project will be retained and NO REFUND will be issued by Contractor if Client cancels after 10 days from the initial sale and project is live.</div><p><strong>TERMINATION OF AGREEMENTS:</strong></p><div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\">Both the Client and ourselves have the right to terminate any Services Agreement for any reason, including the ending of services that are already underway. No refunds shall be offered, where a Service is deemed to have begun and is, for all intents and purposes, underway. If the Client cancels an account before the work is completed or site is live, a cancellation fee is retained per the Cancellation Fee and Refund Policy (SEE Cancellation Fee and Refund Policy). Client agrees that all fees incurred and billed prior to cancellation effective date are valid and Client agrees to pay. Upon request for termination of services the website will be removed. A back-up copy of the website/software is not maintained by SiKi Realtor (Dept. of IT).</div><p><strong>COPYRIGHT NOTICE:</strong></p><div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\">Copyright and other relevant intellectual property rights exist on all text relating to the Company’s services and the full content of this website.</div><p><br></p><h2><cite><var><code>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</code></var></cite><span class=\"marker\"><code><strong>To hire Us&nbsp;<a data-cke-saved-href=\"https://www.sikibd.com/contact-us\" href=\"https:/