(2, '/public/upload/blogs/16619190441.png', '/public/upload/teams/1661839628\'Cause there\'s nobody like you! (21).png', '<p>All over Dhaka city we offer all kinds of&nbsp;property solutions. We are providing a highly expart property consultant.</p><p><br></p><p>Consultant helps you to BUY-SELL-RENT your property. Our consultant works as your personal agent and fulfills your requirements.</p><ul><li><strong>Find Property:</strong> Consultants help you to find the property as per your requirements like Apartment, Land or Rental Space or Commercial Space. Time to time we send you the details of the property that match with your requirement through online (WhatsApp/Email or any other virtual way you prefer). We have more then 200+ Exclusive Inventory all over Dhaka! Find your dream property!</li></ul><p><br></p><p><img data-cke-saved-src=\"data:image/jpeg;base64,\" src=\"data:image/jpeg;base64,\" style=\"float:none; width:50%\"></p><p><br></p><ul><li><strong>Visit Property:</strong> Our consultants arrange a practical view for understanding the property. We match the property as per your requirements and then we arrange a suitable time for viewing the property.</li></ul><p><br></p><ul><li><strong>Legal Support:</strong> Our expert legal consultants provide all types of Legal vetting regarding accomplishing the deal they also help you to fix the terms &amp; condition with the person to whom you deal for a win-win situation. We also help you to complete registration &amp; Mutation.</li></ul><p><br></p><ul><li><strong>Interior: </strong>We provide interior support with highly expert interior designer (architect) &amp; workers for finest finishing for your dream house.</li></ul>', NULL, NULL);

